import React from "react";
import Room from "./Room";
import Axios from "axios";
import Moment from 'moment';
const RoomsList = ({ rooms, props }) => {
  var niz=[];
  var idovi=[];
  console.log(props)
  Axios.get("http://localhost:3001/raspoloziveSobe?start_date="+Moment(props.startDate).format('YYYY-MM-DD hh:mm:ss')+"&end_date="+Moment(props.startDate).format('YYYY-MM-DD hh:mm:ss')).then((result, fields)=>{
    //niz=new Array(result);
    alert("successfully filtered rooms!");
    console.log(Moment(props.startDate).format('YYYY-MM-DD hh-mm-ss'));
    niz=result.data;
    niz.forEach(item => {
      idovi.push(item.id_soba)
    });
    console.log(niz)
    console.log(idovi)
  });
  if (rooms.length === 0) {
    return (
      <div className="empty-search">
        <h3>Na≈æalost nema soba koje zadovoljavaju date kriterije</h3>
      </div>
    );
  }
  var raspolozivo=false;
  console.log(rooms[0].item.id)
  var sobe = rooms.map(item => {
    raspolozivo=false;
    idovi.map(id_soba=>{
      if(id_soba==item.id){raspolozivo=true;} 
    })
    if(raspolozivo){console.log(item.id); return item;} 
  })
  console.log(props);
  return (
    <section className="roomslist">
      <div className="roomslist-center">
        {sobe.map(item => {
           return <Room props={props} key={item.id} room={item} />;
          
          
        })}
      </div>
    </section>
  );
};

export default RoomsList;
